/**
 * @description: 添加款式库-弹窗保存、背景模板保存
 * @param {*} main_id 主报告报告ID
 * @param {*} content json字符串
 * @param {*} type 6 背景模板
 */
export function saveStyleResource(main_id, content, type) {
  return request({
    url: "/api/report/saveStyleResource",
    method: "post",
    data: {
      main_id,
      content,
      type
    }
  });
}

/**
 * @description: 左侧列表获取
 * @param {*} type 1(款式模板)、2(图片素材)、3(款式库图)、6(背景模板)
 * @param {*} publicVal 是否公共(个人0、共用模板1)
 */
export function getResource(main_id, type, page, publicVal, label_id) {
  return request({
    url: "/api/report/resource",
    method: "post",
    data: {
      main_id,
      type,
      page,
      public: publicVal,
      label_id
    }
  });
}

/**
 * @description: 清空款式库/素材
 * @param {*} main_id 主报告报告ID
 * @param {*} type 素材类型（1=报告模板，2=图片素材，3=款式库，4=文字模板）
 */
export function clearResource(main_id, type) {
  return request({
    url: "/api/report/resourceClear",
    method: "post",
    data: {
      main_id,
      type
    }
  });
}

/**
 * @description: 删除款式库/素材
 * @param {*} id 素材ID
 */
export function deleteResource(id) {
  return request({
    url: "/api/report/resourceDelete",
    method: "post",
    data: {
      id
    }
  });
}

/**
 * @description: 另存为保存模板
 * @param {*} publicVal 是否公共(个人0、共用模板1)
 * @param {*} title 名称
 * @param {*} content 内容
 * @param {*} canvas base64缩略图
 */
export function saveTemplate(title, publicVal, content, cover) {
  return request({
    url: "/api/report/saveTemplate",
    method: "post",
    data: {
      title,
      public: publicVal,
      content,
      cover
    }
  });
}

