/**
 * @description: 编辑主报告标题
 * @param {*} main_id 主报告ID
 */
export function editMainTranslate(main_id, sTitle, sDesc) {
  return request({
    url: "/api/report/mainTranslate",
    method: "post",
    data: { main_id, sTitle, sDesc }
  });
}

/**
 * @description: 审核
 * @param {*} main_id 主报告ID
 * @param {*} iVerifyStatus 1-审核通过、2-审核中、3-审核退回
 */
export function translateVerify(main_id, iVerifyStatus) {
  return request({
    url: "/api/report/translateVerify",
    method: "post",
    data: { main_id, iVerifyStatus }
  });
}

/**
 * @description: 保存base64图片
 * @param {*} base64Image base64字符串
 */
export function saveBase64Image(data) {
  return request({
    url: "/api/image/saveBase64Image",
    method: "post",
    data
  });
}
